import React, { useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import Navbar from '../../../components/Navbar';

function Checkout() {
  const location = useLocation();
  const navigate = useNavigate();
  const { cartItems } = location.state || { cartItems: [] };

  const [paymentMethod, setPaymentMethod] = useState('');
  const [shippingDetails, setShippingDetails] = useState({
    name: '',
    address: '',
    phone: ''
  });

  const totalPrice = cartItems.reduce((total, item) => total + (item.price * item.cartQuantity), 0);

  const handlePlaceOrder = () => {
    if (!paymentMethod || !shippingDetails.name || !shippingDetails.address || !shippingDetails.phone) {
      alert('Please fill in all details');
      return;
    }

    // Here you would typically make an API call to create an order
    const orderData = {
      items: cartItems,
      totalPrice,
      paymentMethod,
      shippingDetails
    };

    // Simulating order placement
    if (paymentMethod === 'online') {
      // Redirect to payment gateway or dummy payment page
      navigate('/payment', { state: { orderData } });
    } else {
      // For Cash on Delivery, directly create order
      alert('Order Placed Successfully with Cash on Delivery');
      navigate('/orders');
    }
  };

  return (
    <div className="checkout-container">
      <Navbar />
      <div className="checkout-content">
        <h1>Checkout</h1>
        
        {/* Order Summary */}
        <div className="order-summary">
          <h2>Order Summary</h2>
          {cartItems.map(item => (
            <div key={item.id} className="order-item">
              <span>{item.name}</span>
              <span>Quantity: {item.cartQuantity}</span>
              <span>₹{item.price * item.cartQuantity}</span>
            </div>
          ))}
          <h3>Total: ₹{totalPrice}</h3>
        </div>

        {/* Shipping Details */}
        <div className="shipping-details">
          <h2>Shipping Details</h2>
          <input 
            type="text" 
            placeholder="Full Name" 
            value={shippingDetails.name}
            onChange={(e) => setShippingDetails({...shippingDetails, name: e.target.value})}
          />
          <input 
            type="text" 
            placeholder="Address" 
            value={shippingDetails.address}
            onChange={(e) => setShippingDetails({...shippingDetails, address: e.target.value})}
          />
          <input 
            type="tel" 
            placeholder="Phone Number" 
            value={shippingDetails.phone}
            onChange={(e) => setShippingDetails({...shippingDetails, phone: e.target.value})}
          />
        </div>

        {/* Payment Method */}
        <div className="payment-method">
          <h2>Payment Method</h2>
          <div>
            <input 
              type="radio" 
              id="cod" 
              name="payment" 
              value="cod"
              checked={paymentMethod === 'cod'}
              onChange={() => setPaymentMethod('cod')}
            />
            <label htmlFor="cod">Cash on Delivery</label>
          </div>
          <div>
            <input 
              type="radio" 
              id="online" 
              name="payment" 
              value="online"
              checked={paymentMethod === 'online'}
              onChange={() => setPaymentMethod('online')}
            />
            <label htmlFor="online">Online Payment</label>
          </div>
        </div>

        <button onClick={handlePlaceOrder}>Place Order</button>
      </div>
    </div>
  );
}

export default Checkout;
